import "./App.css";
import Nav from "./components/nav";
import WhichWaterDoYouDrink from "./components/which-water-do-you-drink";
import TableForInvalid from "./components/table-for-invalid";
import { BrowserRouter } from "react-router-dom";
import { getWaterBrands } from "./data";

function App() {
  const waterBrands = getWaterBrands();

  return (
    <BrowserRouter>
      <Nav />
      <Route />
      {waterBrands.map(waterBrand => (
        <Route key={waterBrand.id} path={`/${waterBrand.id}`}>
          <h1>{waterBrand.name}</h1>
